return                                                  (
<div 
id='contacts' 
style={{
	display:'flex',
	justifyContent:'spaceAround',
	width:'width'
}}>

<span 
style={{
	width:'33%'
}}
>
<MdCall 
size="2em"
/>
{` Toll free 1800 200 1234`}
</span>

<span
style={{
	width:'33%'
}}>
<FaFacebook 
size="2em"/>
{` Facebook`}
</span>

<span
style={{
	width:'33%'
}}>
<FaGlobe 
size="2em" />
{` Website`}
</span>
</div>
);
}
export default Contact;
